A AÇÃO SECRETA DA MAÇONARIA NA POLÍTICA MUNDIAL


Este livro volta-se para a demonstração do possível papel da Maçonaria durante acontecimentos políticos e sociais da História do Mundo e do Brasil. Esta obra pretende desmistificar a ideia de ordem religiosa, através da demonstração da preocupação com os ideais de Liberdade, Igualdade e Fraternidade.

